import {Link} from 'react-router-dom';
import logo from "../images/HigherEducationLogo.png";

export default function Header2({
    heading,
    paragraph,
    linkName,
    linkUrl="#"
}){
    return(
        <div className="pb-10 bg-[#73783c] pt-10  w-full max-w-lg mr-auto ml-auto ">
            <h2 className=" text-center text-3xl  font-extrabold text-gray-900">
                {heading}
            </h2>
            <div className="flex justify-center">
                <div className=" w-29 h-29">
                    <img className=" w-25 h-24 mr-auto ml-auto " src={logo} alt=""/>
                </div>
            </div>
            <h1 className=" text-center text-2xl text-gray-100 ">
            {paragraph} {' '}
            <Link to={linkUrl} className="font-medium text-gray-600 hover:text-gray-500">
                {linkName}
            </Link>
            </h1>
        </div>
    )
}
